// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import {IERC20} from "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import {ERC20} from "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import {IDexHandlerFactory} from "./interfaces/IDexHandlerFactory.sol";
import {SwapMultiHop, SwapDescription} from "./structs/SAggregator.sol";
import {Address} from "./libraries/Address.sol";
import {SafeERC20} from "./libraries/SafeERC20.sol";
import {UniERC20} from "./libraries/UniERC20.sol";

contract AggregatorExecutor {
    using Address for address;
    
    function swapMultiHop(
        SwapMultiHop calldata params,
        SwapDescription calldata desc,
        IDexHandlerFactory factory
    ) external returns(uint256 amountOut) {
        require(desc.amountIn != 0, "The amount for swap is zero");
        address dexHandler;
        uint256 amountIn = desc.amountIn;

        IERC20(desc.tokenIn).transferFrom(msg.sender, address(this), desc.amountIn);
    
        for (uint8 i = 0; i < params.routers.length; i++) {
            address _tokenIn = params.tokenIn[i];
            dexHandler = factory.dexHandlers(params.dexHandlerIds[i]);
            IERC20(_tokenIn).approve(params.routers[i], amountIn);
            bytes memory result = address(dexHandler).functionDelegateCall(abi.encodeWithSignature("executeSwap(address,bytes)", params.routers[i], params.data[i]));
            amountOut = abi.decode(result, (uint256));
            amountIn = amountOut;
        }
    }
}

contracts/DexHandlerFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import {IDexHandlerFactory} from "./interfaces/IDexHandlerFactory.sol";
import {EnumerableSet} from "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

contract DexHandlerFactory is IDexHandlerFactory {
    using EnumerableSet for EnumerableSet.AddressSet;

    EnumerableSet.AddressSet private _handlers;
    address public owner;

    event HandlersAdded(uint8 indexed id, address indexed handler);
    event HandlerRemoved(uint8 indexed id, address indexed handler);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function setDexHandler(
        address dexHandler
    ) external onlyOwner returns (uint8) {
        require(dexHandler != address(0), "Dex handler is zero address");

        _handlers.add(dexHandler);
        uint8 id = uint8(_handlers.length() - 1);

        emit HandlersAdded(id, dexHandler);

        return id;
    }

    function removeHandler(uint8 id) external onlyOwner {
        address handlerToRemove = _handlers.at(id);
        _handlers.remove(handlerToRemove);

        emit HandlerRemoved(id, handlerToRemove);
    }

    function dexHandlers(uint8 id) external view returns (address) {
        require(id < _handlers.length(), "Invalid handler ID");
        return _handlers.at(id);
    }
}

